C# mongodb with strongly typed ID using records<p>I'm playing with strongly typed IDs using C#9 records with Mongo. I've successfuly managed to make inserting work but reading is throwing an exception (see below).</p>
<p>These are the model definitions. Pretty simple, <code>TestModel</code> has a <code>TestModelId</code> typed as a <code>StronglyTypedId&lt;Guid&gt;</code>.</p>
<pre class="lang-cs prettyprint-override"><code>public record TestModel(TestModelId Id, string value, string? value1);
public record TestModelId(Guid Id) : StronglyTypedId&lt;Guid&gt;(Id);
public abstract record StronglyTypedId&lt;TValue&gt;(TValue Id) where TValue : notnull;
</code></pre>
<p>These require a registration of a serialization provider and a serializer class.</p>
<p>Registration:</p>
<pre class="lang-cs prettyprint-override"><code>var guidSerializer = BsonSerializer.SerializerRegistry.GetSerializer&lt;Guid&gt;();
BsonSerializer.RegisterSerializationProvider(new IdSerializationProvider(guidSerializer));
</code></pre>
<p>Serializers:</p>
<pre class="lang-cs prettyprint-override"><code>public class IdSerializationProvider : IBsonSerializationProvider
{
    private IBsonSerializer&lt;Guid&gt; guidSerializer;

    public IdSerializationProvider(IBsonSerializer&lt;Guid&gt; guidSerializer)
    {
        this.guidSerializer = guidSerializer;
    }

    public IBsonSerializer? GetSerializer(Type type)
    {
        if(type.BaseType != null &amp;&amp; type.BaseType == typeof(StronglyTypedId&lt;Guid&gt;)) 
            return new TestModelSerializer(type, guidSerializer);

        return null;
    }
}

public class TestModelSerializer : SerializerBase&lt;StronglyTypedId&lt;Guid&gt;&gt;
{
    private readonly Type targetType;
    private readonly IBsonSerializer&lt;Guid&gt; guidSerializer;

    public TestModelSerializer(Type targetType, IBsonSerializer&lt;Guid&gt; guidSerializer)
    {
        this.targetType = targetType;
        this.guidSerializer = guidSerializer;
    }

    public override void Serialize(BsonSerializationContext context, BsonSerializationArgs args, StronglyTypedId&lt;Guid&gt; value)
    {
        guidSerializer.Serialize(context, args, value.Id);
    }

    public override StronglyTypedId&lt;Guid&gt; Deserialize(BsonDeserializationContext context, BsonDeserializationArgs args)
    {
        var guid = guidSerializer.Deserialize(context, args);
        var idType = Activator.CreateInstance(targetType, new object[] { guid });
        return (idType as StronglyTypedId&lt;Guid&gt;)!;
    }
}
</code></pre>
<p>The code below for inserting a new document works.</p>
<pre class="lang-cs prettyprint-override"><code>MongoClient dbClient = new MongoClient(&quot;mongodb://localhost:27017&quot;);
IMongoCollection&lt;TestModel&gt; collection = dbClient.GetDatabase(&quot;test&quot;).GetCollection&lt;TestModel&gt;(&quot;testmodel&quot;);

TestModel model = new TestModel(new TestModelId(Guid.NewGuid()), &quot;test&quot;, &quot;test&quot;);
collection.InsertOne(model);
</code></pre>
<p>But reading using <code>Find</code> is throwing an exception:
<code>System.InvalidOperationException: 'The operands for operator 'Equal' do not match the parameters of method 'op_Equality'.'</code></p>
<pre class="lang-cs prettyprint-override"><code>TestModel found = collection.Find(x =&gt; x.Id == model.Id).FirstOrDefault();
</code></pre>
<p>I tried using <code>Equals</code> instead, like this</p>
<pre class="lang-cs prettyprint-override"><code>TestModel found = collection.Find(x =&gt; x.Id.Equals(model.Id)).FirstOrDefault();
</code></pre>
<p>But this is throwing another exception: <code>System.ArgumentException: 'Method 'Boolean Equals(WebApplication2.Controllers.TestModelId)' declared on type 'WebApplication2.Controllers.TestModelId' cannot be called with instance of type 'WebApplication2.Controllers.StronglyTypedId`1[System.Guid]''</code></p>
<p>I'm not sure what's happening there, the type definitions are pretty clear but for some reason there seems to be a type mismatch? I tried to google any solution to this but couldn't find anything.</p>

