MongoDB: Is there another way to match by date other than ISODate in an aggregation?<p>My question is relatively simple. I have a collection of documents that look like this</p>
<pre><code>    {
     _id:&quot;61f52b609f97a100092842f2&quot;
     timestampISO:2022-01-29T11:56:14.000+00:00
    }
</code></pre>
<p>The timestampISO is a date type.</p>
<p>Is there a way to match by date without using ISODate(&quot;...&quot;) as seen in this <a href="https://stackoverflow.com/a/15025828">answer</a> ? I am trying not to use ISODate('') as I would actually like to save the pipeline as a string in Mongo but that is not important right now.</p>
<p>I would like to have a match like this</p>
<pre><code>$match: {
   timestampISO: {
       $gte: {
          $dateFromString: {
            dateString: '2022-01-01T11:56:14.000+00:00',
          }
       },
       $lte: {
          $dateFromString: {
            dateString: '2022-01-29T11:56:14.000+00:00',
          }
       },
   }
}
</code></pre>
<p>which does not work. It seems as though ISODate() seems to be the only way? Is this correct?</p>
<p>Thank you for your time.</p>

