Why does req.params.id return "undefined"?<p>Learning about the concept of microservices in Nodejs, I have set up two microservices <strong>auth</strong> and <strong>users</strong>, both standalone and running on different ports.</p>
<p>The auth service handles user creation and log-in users using a username and password. This works as expected. I've used jwt to generate the tokens. I can easily create a user, create a session token and verify its validity.</p>
<p>My second service, users, I intend to use to show greetings to users and fetch a user's detail. I need to use the auth service to know when a user is logged in in this setting.</p>
<p>However, with my current workings, when I try to go to an endpoint, <code>/users/:id/sayhello</code> with a valid user id and a valid token passed in the headers, I get the following errors:</p>
<p><code>TypeError: Cannot read properties of undefined (reading 'id') at /path/auth/verifyToken.js:23:21 </code>.</p>
<p>And then this; from jwt:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;name&quot;: &quot;JsonWebTokenError&quot;,
    &quot;message&quot;: &quot;secret or public key must be provided&quot;
}
</code></pre>
<p>Let's look at my setup now.</p>
<p>Here's my <strong>verifyToken.js</strong> file from the <strong>auth</strong> service:</p>
<pre class="lang-js prettyprint-override"><code>const verifyToken = (req, res, next)=&gt;{
    const authHeader = req.headers.token
    // split the header, and get the token &quot;Bearer token&quot;
    const token = authHeader.split(&quot; &quot;)[1];
    if (authHeader) {
        jwt.verify(token, process.env.JWT_SEC, (err, user)=&gt;{
            if (err) res.status(403).json(err);
            req.user = user
            next();
        })
    } else {
        return res.status(401).json(&quot;You are not authenticated&quot;)
    }
}

const verifyTokenAndAuthorization = (req, res, next) =&gt;{
    verifyToken(req, res, ()=&gt;{
        if(req.user.id === req.params.id){ // error traced back to this line
        next();
        }else{
            res.status(403).json(&quot;Permission denied!&quot;);
        }
    })
}

</code></pre>
<p>From my <strong>users</strong> service, here's the code that uses the auth service to know when the user is logged in then say hello.</p>
<pre class="lang-js prettyprint-override"><code>app.get(&quot;/users/:id/sayhello&quot;, verifyTokenAndAuthorization, async (req, res) =&gt; {
  try {
    const user = await User.findById(req.params.id);
    console.log(req.params.id) // undefined
    res.status(200).json(`Hello ${user.username}`);
  } catch (error) {
    res.status(500).json(error);
  }
});

</code></pre>
<p>I've with no success sought any leads from similar posts like <a href="https://stackoverflow.com/questions/25590370/why-is-req-params-returning-undefined">A</a>,<a href="https://stackoverflow.com/questions/47121773/req-params-id-is-undefined-i-cant-figure-out-why">B</a> and <a href="https://stackoverflow.com/questions/31227212/req-params-id-is-undefined">C</a></p>
<p>I'm not sure of what's not right. I'll appreciate possible suggestions and leads towards a fix.</p>

